use std::collections::{hash_map::Entry, HashMap};

pub struct Solution;

impl Solution {
    pub fn is_anagram(s: String, t: String) -> bool {
        let mut map = HashMap::with_capacity(s.len());

        for c in s.chars() {
            *map.entry(c).or_insert(0) += 1u16;
        }

        for c in t.chars() {
            match map.entry(c) {
                Entry::Vacant(_) => {
                    return false;
                }
                Entry::Occupied(mut entry) => {
                    *entry.get_mut() -= 1;
                }
            }
        }

        map.values().all(|count| *count == 0)
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test1() {
        let s = "anagram".to_string();
        let t = "nagaram".to_string();
        assert!(Solution::is_anagram(s, t));
    }

    #[test]
    fn test2() {
        let s = "rat".to_string();
        let t = "car".to_string();
        assert!(!Solution::is_anagram(s, t));
    }

    #[test]
    fn test3() {
        let s = "".to_string();
        let t = "".to_string();
        assert!(!Solution::is_anagram(s, t))
    }

    #[test]
    fn test4() {
        let s = "".to_string();
        let t = "".to_string();
        assert!(Solution::is_anagram(s, t))
    }
}
